begin
  wwv_flow_api.create_sw_sql_cmds (
    p_id => 55851339102613944
 ,p_command =>
'DECLARE'||wwv_flow.LF||
'	l_ips VARCHAR2(32000) := NULL;'||wwv_flow.LF||
'	l_ips_cnt NUMBER := 0;'||wwv_flow.LF||
'	l_r_ip VARCHAR2(255) := NULL;'||wwv_flow.LF||
'	l_f_ip VARCHAR2(255) := NULL;'||wwv_flow.LF||
'	l_ip VARCHAR2(255) := NULL;'||wwv_flow.LF||
'BEGIN'||wwv_flow.LF||
'	l_r_ip := OWA_UTIL.GET_CGI_ENV(''x-real-ip'');'||wwv_flow.LF||
'	--l_ips := OWA_UTIL.GET_CGI_ENV(''x-forwarded-for'');'||wwv_flow.LF||
'	l_ips := ''172.155.1.223, 172.155.0.202'';'||wwv_flow.LF||
'	DBMS_OUTPUT.PUT_LINE(''l_ips:''||l_ips);'||wwv_flow.LF||
'  '||wwv_flow.LF||
'	BEGIN'||wwv_flow.LF||
'		SELECT ips, ips_count'||wwv_flow.LF||
'		INTO l_f_ip, l_ips_cnt'||
''||wwv_flow.LF||
'		FROM'||wwv_flow.LF||
'		('||wwv_flow.LF||
'			SELECT the_level, TRIM(ips) AS IPS, COUNT(*) OVER (PARTITION BY NULL) AS IPS_COUNT'||wwv_flow.LF||
'			'||wwv_flow.LF||
'			FROM'||wwv_flow.LF||
'			('||wwv_flow.LF||
'				SELECT LEVEL THE_LEVEL, REGEXP_SUBSTR(l_ips,''[^,]+'', 1, LEVEL) ips'||wwv_flow.LF||
'				FROM DUAL'||wwv_flow.LF||
'				CONNECT BY REGEXP_SUBSTR(l_ips, ''[^,]+'', 1, LEVEL) IS NOT NULL'||wwv_flow.LF||
'			)'||wwv_flow.LF||
'			WHERE TRIM(ips) IS NOT NULL'||wwv_flow.LF||
'		)'||wwv_flow.LF||
'		WHERE the_level = 1;'||wwv_flow.LF||
'	EXCEPTION '||wwv_flow.LF||
'		WHEN OTHERS THEN'||wwv_flow.LF||
'			l_f_ip := NULL;'||wwv_flow.LF||
'			l_ips_cnt := 0;'||wwv_flow.LF||
'	'||
'END;'||wwv_flow.LF||
'	'||wwv_flow.LF||
'	DBMS_OUTPUT.PUT_LINE(''l_ips_cnt:''||l_ips_cnt);'||wwv_flow.LF||
'	DBMS_OUTPUT.PUT_LINE(''l_f_ip:''||l_f_ip);'||wwv_flow.LF||
'	'||wwv_flow.LF||
'	IF l_ips_cnt > 1 AND l_f_ip IS NOT NULL THEN'||wwv_flow.LF||
'		l_ip := l_f_ip;'||wwv_flow.LF||
'	END IF;'||wwv_flow.LF||
'	'||wwv_flow.LF||
'	IF l_ip IS NULL THEN'||wwv_flow.LF||
'		l_ip := l_r_ip;'||wwv_flow.LF||
'	END IF;'||wwv_flow.LF||
'	'||wwv_flow.LF||
'	IF l_ip IS NULL THEN'||wwv_flow.LF||
'		l_ip := OWA_UTIL.GET_CGI_ENV(''remote_addr'');'||wwv_flow.LF||
'	END IF;'||wwv_flow.LF||
'	'||wwv_flow.LF||
'	DBMS_OUTPUT.PUT_LINE(''l_ip:''||l_ip);'||wwv_flow.LF||
'END;'
    ,p_created_by => 'ADMIN'
    ,p_created_on => to_date('201811301155','YYYYMMDDHH24MI')
    ,p_parsed_schema => 'DL_BORDERCONTROL');
end;
