begin
  wwv_flow_api.create_sw_sql_cmds (
    p_id => 765203081951627965
 ,p_command =>
'SELECT d, r'||wwv_flow.LF||
'FROM'||wwv_flow.LF||
'('||wwv_flow.LF||
'    -- 1'||wwv_flow.LF||
'    SELECT NVL(vt.display_value, vt.display_value$dlc) || NVL2(vt.permit_days, '' - ''|| vt.permit_days, '''') d, vt.key_value r, DECODE(vis.defaultvisa, ''Y'', -2, 0) SORT_ORDER'||wwv_flow.LF||
'    FROM dl_common.visa_types$lc vt,'||wwv_flow.LF||
'    dl_bordercontrol.v_visabynation vis'||wwv_flow.LF||
'    WHERE vt.is_active = ''Y'''||wwv_flow.LF||
'    AND vt.key_value != ''0022'''||wwv_flow.LF||
'    AND vis.countcd = (SELECT icao.notice$dlc FROM dl_common.i'||
'cao_doc_codes$lc icao WHERE icao.key_value = :P17_NATIONALITY)'||wwv_flow.LF||
'    AND vis.actflag = ''Y'''||wwv_flow.LF||
'    AND vt.key_value = vis.visatypecd'||wwv_flow.LF||
'    UNION ALL'||wwv_flow.LF||
'    -- 2'||wwv_flow.LF||
'    SELECT NVL(vt.display_value, vt.display_value$dlc) || NVL2(vt.permit_days, '' - ''|| vt.permit_days, '''') d, vt.key_value r, CASE WHEN vt.key_value = ''0008'' THEN -1 ELSE TO_NUMBER(vt.notice$dlc) END SORT_ORDER'||wwv_flow.LF||
'    FROM dl_common.visa_types$lc vt'||wwv_flow.LF||
'   '||
' WHERE vt.is_active = ''Y'''||wwv_flow.LF||
'    AND vt.key_value != ''0022'''||wwv_flow.LF||
'    AND vt.key_value NOT IN '||wwv_flow.LF||
'	('||wwv_flow.LF||
'		SELECT vt.key_value'||wwv_flow.LF||
'		FROM dl_common.visa_types$lc vt,'||wwv_flow.LF||
'		dl_bordercontrol.v_visabynation vis'||wwv_flow.LF||
'		WHERE vt.is_active = ''Y'''||wwv_flow.LF||
'		AND vt.key_value != ''0022'''||wwv_flow.LF||
'		AND vis.countcd = (SELECT icao.notice$dlc FROM dl_common.icao_doc_codes$lc icao WHERE icao.key_value = :P17_NATIONALITY)'||wwv_flow.LF||
'		AND vis.actflag = ''Y'''||wwv_flow.LF||
'		AND vt.key_'||
'value = vis.visatypecd'||wwv_flow.LF||
'	)'||wwv_flow.LF||
')'||wwv_flow.LF||
'ORDER BY sort_order'||wwv_flow.LF||
';'
    ,p_created_by => 'ADMIN'
    ,p_created_on => to_date('201902071131','YYYYMMDDHH24MI')
    ,p_parsed_schema => 'DL_BORDERCONTROL');
end;
