,p_template_id=>wwv_flow_api.id(50479715159513983)
,p_source_type=>'QUERY_1_ROW'
,p_format=>'DEFAULT'
,p_method=>'GET'
,p_require_https=>'NO'
,p_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT',
'    i.key_value,',
'    i.unique_value,',
'    i.salutation,',
'    i.surname,',
'    i.middle_name,',
'    i.given_name as givenname,',
'    TO_CHAR(i.date_of_birth,''YYYY-MM-DD'') AS date_of_birth,',
'    i.place_of_birth,',
'    i.country_of_birth,',
'    i.nationality,',
'    i.sex,',
'    i.notice,',
'    i.profession,',
'    i.body_height,',
'    i.body_weight,',
'    i.body_shape,',
'    i.hair_color,',
'    i.hair_characteristic,',
'    i.face_shape,',
'    i.eye_color,',
'    i.skin,',
'    ----------------------------------------',
'    NVL((    SELECT  ''true''   ',
'             FROM    dl_blacklist.blacklist_case_identities t,',
'                     dl_blacklist.blacklist_cases c',
'             WHERE   t.identity = i.key_value',
'             AND     c.id = t.blacklist_case        ',
'             AND     ( SYSDATE BETWEEN c.arrested_warrant_date AND c.arrested_warrant_expiry_date   ',
'                       OR COALESCE( c.arrested_warrant_date, c.arrested_warrant_expiry_date ) IS NULL ',
'                     )',
'             AND     ROWNUM = 1',
'       ), ''false'' ) AS ACTIVE_WARRENT',
'    ----------------------------------------    ',
'FROM',
'    dl_blacklist.identities i',
'    INNER JOIN dl_blacklist.blacklist_case_identities c ON c.identity = i.key_value',
'    INNER JOIN dl_blacklist.biometrics b ON b.blacklist_case_id = c.blacklist_case',
'WHERE',
'    b.abis_id =:abis_id',
'    AND ROWNUM = 1'))
);
