,p_source_type=>'PLSQL'
,p_format=>'DEFAULT'
,p_method=>'POST'
,p_mimes_allowed=>'application/json'
,p_require_https=>'NO'
,p_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
'  v_JS_Status JSON_OBJECT_T;',
'  v_Result    clob;',
'  v_Buffer    varchar2(16384 char);',
'  v_Offset    integer := 1;',
'  v_Amount    integer := 16384;',
'  v_SQLCODE   number;',
'  v_SQLERRM   varchar2(32767);',
'begin',
'  v_JS_Status := JSON_OBJECT_T();',
'  OWA_UTIL.mime_header(''application/json''',
'                      ,true',
'                      ,''UTF-8'');',
'  v_Result := DL_BLACKLIST.PKG_SEARCH.SearchBLDemographic$JSON(DL_COMMON.PKG_UTIL.BLOB2CLOB(:body));',
'  begin',
'    v_JS_Status.put(''code''',
'                   ,''SUCCESS'');',
'    v_JS_Status.put_Null(''message'');',
'    v_JS_Status.put_Null(''stack'');',
'    htp.prn(''{"status":'');',
'    htp.prn(v_JS_Status.Stringify());',
'    htp.prn('',"candidates":'');',
'    loop',
'      DBMS_LOB.read(v_Result',
'                   ,v_Amount',
'                   ,v_Offset',
'                   ,v_Buffer);',
'      v_Offset := v_Offset + v_Amount;',
'      htp.prn(v_Buffer);',
'    end loop;',
'  exception',
'    when NO_DATA_FOUND then',
'      htp.prn(''}'');',
'      DL_COMMON.PKG_UTIL.FreeTempLOB(v_Result);',
'    when others then',
'      DL_COMMON.PKG_UTIL.FormatErrMsg(v_SQLCODE',
'                                     ,v_SQLERRM);',
'      DL_COMMON.PKG_UTIL.FreeTempLOB(v_Result);',
'      Raise_application_error(v_SQLCODE',
'                             ,v_SQLERRM);',
'  end;',
'exception',
'  when others then',
'    DL_COMMON.PKG_UTIL.FormatErrMsg(v_SQLCODE',
'                                   ,v_SQLERRM);',
'    v_JS_Status.put(''code''',
'                   ,''ERROR'');',
'    v_JS_Status.put(''message''',
'                   ,DL_COMMON.PKG_UTIL.ShortErrMsg(v_SQLERRM));',
'    v_JS_Status.put(''stack''',
'                   ,v_SQLERRM);',
'    htp.prn(''{"status":'');',
'    htp.prn(v_JS_Status.Stringify());',
'    htp.prn('',"candidates":null'');',
'    htp.prn(''}'');',
'end;',
''))
);
